Next to clicking switches, Jester can react to events send either from C++ or also from within Lua. The system follows a simple observer/listener pattern: ListenTo("go_silent", function(task) task:Click("Radar Power", "STBY")
end) with: if is_aar then DispatchEvent("go_silent")
end

827.body:
Dialogs are shown on-demand and in-order. They are displayed for a certain time and the user is given a chance to engage in the dialog or ignore it - upon which it will expire and vanish. A dialog consists of a question with up to 4 selectable options. An option is either final or triggers a follow-up question with new options to select from. Dialogs are hold and shown from a queue. A new dialog can be pushed to the queue via: Dialog.Push(dialog) The following shows a simple example to add a new dialog: local fuel_check_dialog = Dialog.Question:new({ name = "Jester", content = "How is the fuel?", phrase = "dialog/fuel_check", label = "Fuel Check", timing = Dialog.Timing:new({ question = s(5), action = s(10), }), options = { Dialog.Option:new({ response = "We are good", action = "fuel_good" }), Dialog.Option:new({ response = "Fuel is low", follow_up_question = Dialog.FollowUpQuestion:new({ name = "Jester", content = "Okay, how do you want to proceed?", phase = "dialog/fuel_low_proceed", options = { Dialog.Option:new({ response = "Remain on Mission" }), Dialog.Option:new({ response = "RTB", action = "fuel_low_rtb" }) }, }), }) },
}) Dialog.Push(fuel_check_dialog) To react to a selected option, listen to the corresponding event: ListenTo("fuel_low_rtb", function(task) -- Component interface task:Click("Nav Panel Function", "TARGET_1") -- or Raw interface task:Then(function() ClickRaw( devices.NavigationComputer_AN_ASN_46A, device_commands.RIO_NAV_COMP_FUNCTION_SELECTOR_KNOB, 3, 5 ) -- Target 1 end)
end)

832.body:
The Phantom features Character Customization . Until the feature and its UI is fully available at a later point during Early Access, some of its features can already be accessed directly by modifying the description.lua file of your Livery. Here's a snippet of the area you need to look at: custom_args =
{ [512] = 0.3, -- 0 is no mirrors, 0 - 0.4 is both mirrors (mickey mouse) and 0.5+ is top mirror only. [2008] = 0.95, --WSO Helmet, 0.95 is HGU-55 [2006] = 0.95, --Pilot Helmet, 0.95 is HGU-55 (expand list of draw args)
} Find the custom_args section which is usually towards the bottom of the file. The numbers inside [] represents the Draw Argument used by DCS to tell the model what your Pilot (and also the aircraft itself) wears. Draw Argument [512] represents the Mirrors on the WSO Canopy . It can be set to a value between 0.0 to 1.0, representing the animation range of the Draw Argument. This value is used to give your pilot a certain helmet, gloves or similar. Or even to define the gender of the pilot model. [2006] is the Draw Argument for the Pilot Helmet. Set it to 0.1 and your pilot will wear an old school HGU-2 helmet. Set it to 0.95 and he will be wearing a more modern HGU-55.

