The Folder ALQ131_g contains a Livery for the ALQ-131 Pod in Olive/Green colors. You can tell your description.lua to use this texture instead of the default white color from DCS when equipping the ALQ-131 to the Phantom in-game by putting the following line of code into your description.lua file for both the Albedo and the Roughmet Texture: { "ALQ_131", 0, "../commons/alq131_g/alq_131_diff", false };
{ "ALQ_131", ROUGHNESS_METALLIC, "../commons/alq131_g/alq_131_diff_roughmet", false }; The first value after the { in Brackets "" is the Material Name, in this case the "ALQ_131". It can be a bit tricky to find these Material names through DCS. Feel free to ask in our Discord in the #liveries-lair channel for help on this. Using the same principle, you can apply custom Flight Suit textures to your Pilot as well as a HGU-2 Texture. Here is an example of a German Luftwaffe F-4F Pilot and the WSO being equipped with German Luftwaffe Flight Suits and Grey HGU-2 Helmets: { "PILOT_HGU-2_Helmet", 0, "../commons/HGU2_g/HGU-2_Helmet", false };
